contracts/LendersFactory.sol.content:
pragma solidity =0.8.4;

// create interfaces for both these contract.
import "./interfaces/IunERC20.sol";
import "./UnERC20Proxy.sol";
import "./interfaces/IDataProvider.sol";
import "./interfaces/ILendersFactory.sol";
import "./interfaces/IInterestRate.sol";
import "@openzeppelin/contracts/proxy/Clones.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

contract LendersFactory is ILendersFactory {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    address proxyImplementation;
    address tokenImplementation;
    IDataProvider dataProvider;
    IInterestRate interestProvider;

    address admin;

    mapping(IERC20 => address) proxyMapping;

    event PaidInterest(
        address sender,
        IERC20 token,
        uint256 amount,
        uint256 numberOfDays
    );

    constructor(
        address _implementation,
        address _tokenImplementation,
        IDataProvider _dataProvider,
        IInterestRate _interestProvider
    ) {
        proxyImplementation = _implementation;
        tokenImplementation = _tokenImplementation;
        dataProvider = _dataProvider;
        interestProvider = _interestProvider;
        admin = msg.sender;
    }

    event LiquidityAdded(address sender, IERC20 token, uint256 amount);
    event LiquidityWithdrawn(address sender, IERC20 token, uint256 amount);

    event IssueLoan(address indexed sender, IERC20 indexed token, uint256 currentTime, uint256 paybackTime, uint256 amount);
    event PaybackLoan(address indexed sender, IERC20 indexed token, uint256 timeOfPayback, uint256 amount);

    function createLiquidityContract(
        address token,
        string calldata name,
        string calldata symbol
    ) external override {
        require(proxyMapping[IERC20(token)] == address(0), "already created");
        address payable proxyContractToken =
            payable(Clones.clone(proxyImplementation));
        UnERC20Proxy initializing = UnERC20Proxy(proxyContractToken);
        address unERC20Address = Clones.clone(tokenImplementation);
        initializing.upgradeTo(unERC20Address);

        IUNERC20 unERC20 = IUNERC20(proxyContractToken);
        unERC20.initialize(token, name, symbol, admin);

        proxyMapping[IERC20(token)] = proxyContractToken;
        dataProvider.addContract(token, name, symbol, proxyContractToken);
    }

    function addLiquidity(uint256 amount, IERC20 token) external override {
        require(
            proxyMapping[token] != address(0),
            "Token Contract Doesn't exist"
        );
        // The token needs to have approval first
        address implementation = getContractAddress(token);
        token.transferFrom(msg.sender, implementation, amount);
        IUNERC20 implementationContract = IUNERC20(implementation);
        implementationContract.increaseSupply(amount, msg.sender);
        dataProvider.updateStatusLiquidityIncr(
            msg.sender,
            address(token),
            amount
        );

        //    // gas inefficient
        //     implementation.call(
        //         abi.encodeWithSignature(
        //             "increaseSupply(uint256,address)",
        //             amount,
        //             msg.sender
        //         )
        //     );

        emit LiquidityAdded(msg.sender, token, amount);
    }

    function withdrawLiquidity(uint256 amount, IERC20 token) external override {
        require(
            proxyMapping[token] != address(0),
            "Token Contract Doesn't exist"
        );

        IUNERC20 liquidityContract = IUNERC20(getContractAddress(token));

        dataProvider.updateStatusLiquidityDecr(
            msg.sender,
            address(token),
            amount
        );

        liquidityContract.decreaseSupply(amount, msg.sender);

        emit LiquidityWithdrawn(msg.sender, token, amount);
    }

    function issueLoan(
        IERC20 token,
        uint256 numberOfDays,
        uint256 amount
    ) external override {
        IUNERC20 liquidityContract = IUNERC20(getContractAddress(token));
        require(
            dataProvider.getInterestPaidStatus(msg.sender, amount) == true,
            "Interest Not Paid"
        );
        liquidityContract.getLoan(msg.sender, numberOfDays, amount);
        dataProvider.updateStatusIssueLoan(msg.sender, address(token), amount);
        dataProvider.setInterestPaidStatus(msg.sender, amount, false);

        emit IssueLoan(msg.sender, token, block.timestamp, block.timestamp + numberOfDays * 1 days, amount);
    }

    function paybackLoan(IERC20 token, uint256 amount) external override {
        IUNERC20 liquidityContract = IUNERC20(getContractAddress(token));
        liquidityContract.paybackLoan(amount, msg.sender);
        dataProvider.updateStatusPaybackLoan(
            msg.sender,
            address(token),
            amount
        );

        emit PaybackLoan(msg.sender, token, block.timestamp, amount);
    }

    function balanceSupply(IERC20 token) external returns (uint256) {
        IUNERC20 liquidityContract = IUNERC20(getContractAddress(token));

        uint256 reward = liquidityContract.balanceSupply();
        // replace with payment to the caller later on
        return reward;
    }

    function payInterest(
        IERC20 token,
        uint256 amount,
        uint256 numberOfDays
    ) public payable {
        (uint256 interest, uint256 security) =
            interestProvider.calculatePaymentAmount(
                token,
                amount,
                numberOfDays
            );
        require(
            msg.value == interest + security,
            "Not the entire interest amount deposited"
        );
        dataProvider.setInterestPaidStatus(msg.sender, amount, true);

        IUNERC20 liquidityContract = IUNERC20(getContractAddress(token));

        liquidityContract.setSecurityDeposit(msg.sender, security);
        emit PaidInterest(msg.sender, token, amount, numberOfDays);
    }

    function getContractAddress(IERC20 token) public view returns (address) {
        address payable tokenAddress = payable(proxyMapping[token]);
        return tokenAddress;
    }

    // migrate usage in data provider to abiEnocdeWIthSignature and remove this repitive function
    function returnProxyContract(IERC20 token)
        external
        view
        override
        returns (address)
    {
        address payable tokenAddress = payable(proxyMapping[token]);
        return tokenAddress;
    }
}

contracts/interfaces/IunERC20.sol.content:
pragma solidity ^0.8.2;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

interface IUNERC20 {
    function initialize(
        address _tokenAddress,
        string calldata name,
        string calldata symbol,
        address admin
    ) external;

    function increaseSupply(uint256 amount, address supplier) external;

    function decreaseSupply(uint256 amount, address sender) external;

    function getLoan(
        address borrower,
        uint256 numberOfDays,
        uint256 amount
    ) external;

    function paybackLoan(uint256 amount, address account) external;

    function balanceSupply() external returns (uint256);

    function getUsedLiquidity() external view returns (uint256);

    function getTotalLiquidity() external view returns (uint256);

    function setSecurityDeposit(address user, uint256 security) external;

    function getSecurityPending(address user) external returns (uint256);
}

contracts/UnERC20Proxy.sol.content:
pragma solidity =0.8.4;

import "@openzeppelin/contracts/proxy/ERC1967/ERC1967Proxy.sol";

contract UnERC20Proxy is ERC1967Proxy {
    constructor(address _logic, bytes memory _data)
        ERC1967Proxy(_logic, _data)
    {}

    function getImplementation() public view returns (address) {
        return _implementation();
    }

    function upgradeTo(address newImplementation) external {
        _upgradeTo(newImplementation);
    }
}

contracts/interfaces/IDataProvider.sol.content:
pragma solidity =0.8.4;

import "./IunERC20.sol";

interface IDataProvider {
    function getThePrice(address) external returns (int256);

    function getInterestPaidStatus(address, uint256)
        external
        view
        returns (bool);

    function setInterestPaidStatus(
        address addr,
        uint256 amount,
        bool status
    ) external;

    function getValuesForInterestCalculation(IUNERC20)
        external
        view
        returns (
            uint256,
            uint256,
            uint256,
            uint256
        );

    function getContractAddress(IERC20 token) external view returns (address);

    function addContract(
        address token,
        string calldata name,
        string calldata symbol,
        address proxy
    ) external;

    function updateStatusIssueLoan(
        address addrUser,
        address contractAddr,
        uint256 amount
    ) external;

    function updateStatusPaybackLoan(
        address addrUser,
        address contractAddr,
        uint256 amount
    ) external;

    function updateStatusLiquidityIncr(
        address addrUser,
        address contractAddr,
        uint256 amount
    ) external;

    function updateStatusLiquidityDecr(
        address addrUser,
        address contractAddr,
        uint256 amount
    ) external;
}

